import React, { Component } from "react";

class Stuff extends Component 
{
         render ()
         {
             return(
                <div>
                   <h2>Stuff Component</h2>
                   <p>Content for Stuff.</p>
                   <ol>
                       <li>One</li>
                       <li>Two</li>
                       <li>Three</li>
                   </ol>
                </div>
             );
         }
}
export default Stuff;
